import React from 'react';

import { Container } from './styles';

function List({title}) {
  return (
      <>
        <Container>
            <header>
              <h2>{title}</h2>

              <ul>
                  <p>Usuário 1</p>
                  <p>Usuário 2</p>
                  <p>Usuário 3</p>
              </ul>
            </header>
        </Container>
      </>
  );
}

export default List;
